import React from 'react';

const FooterComponent = () => {
    return (
        <div>
            <div className="footer">
                <p className="footer__name footer__text">Trường THPT Trần Phú</p>
                <p className="footer__address footer__text">02 Trần Quang Diệu, Phường 10, TP. Đà Lạt</p>
                <p className="footer__license footer__text">© 2015 - Bản quyền thuộc về Trường THPT Trần Phú</p>
            </div>
        </div>
    );
};

export default FooterComponent;
